import React from "react"
import {Avatar,Card} from "antd"
import avat from "../static/img/avat"
export default function About(){
    return(
        <Card
            title="关于我"
        >
            <Avatar
                icon={avat}
            >

            </Avatar>
        </Card>
    )
}
